import React from "react";
import '../style/nav.css';

function NavTabs () {
    return (
        <nav className='nav navbar-tabs'>
            <ul className='nav-tabs'></ul>
                <li className='nav-item'>
                <Link to="/">Home</Link>
                </li>
        </nav>
      );
    }
export default NavTabs;
